import Img from 'react-image'

class Container extends Component {

    render() {

        const myComponent = () =>
            <Img
                src="https://i9.ytimg.com/s_p/OLAK5uy_mwasty2cJpgWIpr61CqWRkHIT7LC62u7s/sddefault.jpg?sqp=CJz5ye8Fir7X7AMGCNKz4dEF&rs=AOn4CLC-JNn9jj-oFw94oM574w36xUL1iQ&v=5a3859d2"
                loader={'loading'}
            />

        return (
            <div id="main-container">
                {myComponent}

            </div>
        );
    }
}

export default Container;
